import './App.css';
import { BrowserRouter as Router , Routes, Route, Link } from 'react-router-dom';
import React, { Component } from 'react'
import Nav from './components/Nav';
import News from './components/News';

export default class App extends Component {
  render() {
    return (
      <Router>
      <div>
        <Nav />
        <Routes>
          technology path='/business' element={<News pageSize ={9} country='in' category='business'/>}/>
          technology'/entertainment' element={<News pageSize ={9} country='in' category='entertainment'/>}/>
          technology'/general' element={<News pageSize ={9} country='in' category='general'/>}/>
          technology'/health' element={<News pageSize ={9} country='in' category='health'/>}/>
          technology'/business' element={<News pageSize ={9} country='in' category='business'/>}/>
          technology'/science' element={<News pageSize ={9} country='in' category='science'/>}/>
          technology'/technology' element={<News pageSize ={9} country='in' category='technology'/>}/>
        </Routes>

      </div>
      </Router>
    )
  }
}
